import dados from '../dados/dadosClientes.json';
import '../design/lista.css';

function lista() {
   return (
      <div className="appLista">
         <header className="appBarLista">
            <ul className="listLista">
               <li className="elemlistLista"><a href="/">Graficos</a></li>
               <li className="elemlistLista"><a href="/cliente">Cadastrar Novos Usuarios</a></li>
               <li><a href="/lucros">Lucros</a></li>/
            </ul>
         </header>
         <main className="mainLista">
            <div className="lista">
               {dados.map((items) => (<div className="ficha"><p>Nome do Cliente: </p><p>{items.nomeCliente}</p><p>Identificação do Cliente: </p><p>{items.numeroCliente}</p><p>Participação na Usina: </p><p>{items.usinas[0].percentualDeParticipacao}</p></div>))}
            </div>
         </main>
      </div>
   )
}
export default lista;
